 ,p_qb_sql => 
'declare'||wwv_flow.LF||
'   i number;'||wwv_flow.LF||
'   j number;'||wwv_flow.LF||
'   k number;'||wwv_flow.LF||
''||wwv_flow.LF||
'procedure findMin(x in number, y in number, z out number) is'||wwv_flow.LF||
'begin'||wwv_flow.LF||
'   if x < y then'||wwv_flow.LF||
'      z := x;'||wwv_flow.LF||
'   else'||wwv_flow.LF||
'      z := y;'||wwv_flow.LF||
'   end if;'||wwv_flow.LF||
'end;'||wwv_flow.LF||
''||wwv_flow.LF||
'begin'||wwv_flow.LF||
'   i := 2;'||wwv_flow.LF||
'   j := 3;'||wwv_flow.LF||
'   findMin(i, j, k);'||wwv_flow.LF||
'   dbms_output.put_line(''Minimum of ''||i||'' and ''||j||'' is: ''||k);'||wwv_flow.LF||
'end;'
