'CREATE OR REPLACE PROCEDURE group_by_cars IS'||wwv_flow.LF||
'  CURSOR c_grouped_data IS'||wwv_flow.LF||
'    SELECT brand, count(model) total_model, ROUND(AVG(quantity), 1) avg_quantity'||wwv_flow.LF||
'    FROM manufacturer'||wwv_flow.LF||
