 ,p_command => 
'CREATE OR REPLACE PROCEDURE group_by_cars(column_name IN varchar) IS'||wwv_flow.LF||
'  CURSOR c_grouped_data IS'||wwv_flow.LF||
'    SELECT brand, count(model) total_model, ROUND(AVG(quantity), 1) avg_quantity'||wwv_flow.LF||
'    FROM manufacturer'||wwv_flow.LF||
'    GROUP BY column_name;'||wwv_flow.LF||
'BEGIN'||wwv_flow.LF||
'  FOR r_grouped_data IN c_grouped_data LOOP'||wwv_flow.LF||
'    DBMS_OUTPUT.PUT_LINE(''Brand: '' || r_grouped_data.brand);'||wwv_flow.LF||
'    DBMS_OUTPUT.PUT_LINE(''Total model: '' || r_grouped_data.total'||
'_model);'||wwv_flow.LF||
'    DBMS_OUTPUT.PUT_LINE(''Average quantity: '' || r_grouped_data.avg_quantity);'||wwv_flow.LF||
'    DBMS_OUTPUT.PUT_LINE(''------------------------'');'||wwv_flow.LF||
'  END LOOP;'||wwv_flow.LF||
'END;'
    ,p_created_by => '210103206@STU.SDU.EDU.KZ'
    ,p_created_on => to_date('202304240804','YYYYMMDDHH24MI')
    ,p_parsed_schema => 'WKSP_OLMESJAN');
